	(20, '1', '1', 16, 'بورجومي بريق طبيعي زجاجة المياه تألق', 'Borjomi Naturally Sparkling Water Glass Bottle', 'وهي فريدة من نوعها المياه المعدنية هيدروكربونات الصوديوم الطبيعية مع التمعدن الطبيعي والكربنة', 'A unique natural Sodium Hydrocarbonate mineral water with natural mineralization and carbonation', 0, 50, 'http://35.196.171.153/isqenidev/download/products/1509365805.jpg', 0, 0, 1, 0, 0, '30', 250.00, 200.00, 200.00, NULL),
	(21, '2', '2', 15, 'دير جيدا لا يزال المياه المعبأة في زجاجات زجاجة بلاستيكية 24 × 500ML', 'Abbey Well Still Bottled Water Plastic Bottle 24 x 500ml', 'دير سكويبس جيدا المياه المعدنية الطبيعية تأتي من مصدر واحد محمي طبيعيا في موربيث، نورثمبرلاند وكل قطرة الماضي تم تصفيتها بشكل طبيعي من خلال المياه تحمل الحجر الرملي الأبيض لمدة لا تقل عن 3000 سنة', 'Schweppes Abbey Well Natural Mineral Water comes from a single naturally protected source in Morpeth, Northumberland, and every last drop has been naturally filtered through water-bearing white sandstone for at least 3,000 years', 0, 56, 'http://35.196.171.153/isqenidev/download/products/1509366610.jpg', 0, 0, 1, 0, 0, '37', 210.00, 200.00, 200.00, NULL),
	(22, '3', '3', 14, 'أكوا بورا لا تزال المياه المعبأة في زجاجات زجاجة بلاستيكية 3 × 5L', 'Aqua Pura Still Bottled Water Plastic Bottle 3 x 5L', 'مستمدة من ما يعتقد أنه واحد من أكبر خزانات المياه الجوفية في أوروبا،', 'Drawn from what is believed to be one of the largest groundwater aquifers in Europe, ', 0, 45, 'http://35.196.171.153/isqenidev/download/products/1509366942.jpg', 0, 0, 1, 0, 0, '23', 300.00, 300.00, 300.00, NULL),
	(23, '4', '4', 13, 'بادويت زجاجة ماء فوارة بطبيعة الحال', 'Badoit Naturally Sparkling Water Glass Bottle', 'بادويت هو ماء طبيعي يتم الحصول عليه من مصادر طبيعية في سانت-غالمير، فرنسا.', 'Badoit is a naturally carbonated water obtained from natural sources in Saint-Galmier, France.', 0, 76, 'http://35.196.171.153/isqenidev/download/products/1509367139.jpg', 0, 0, 1, 0, 0, '34', 100.00, 90.00, 90.00, NULL),
	(24, '5', '5', 12, 'بادويت زجاجة ماء فوارة بطبيعة الحال', 'Badoit Naturally Sparkling Water Glass Bottle', 'بادويت زجاجة ماء فوارة بطبيعة الحال', 'Badoit Naturally Sparkling Water Glass Bottle', 0, 34, 'http://35.196.171.153/isqenidev/download/products/1509367272.jpg', 0, 0, 1, 0, 0, '31', 100.00, 190.00, 200.00, NULL),
	(25, '6', '6', 11, 'بلك فولفيك زجاجة المياه البلاستيكية', 'Blk Fulvic Water Plastic Bottle 12 x 500ml ', 'أكوا أموري تقدم بفخر المياه بلك، أول من أي وقت مضى فولفيك تعزيز المياه المعدنية الطبيعية.', 'Aqua Amore proudly presents blk water, the first ever fulvic-enhanced all-natural mineral water.', 0, 65, 'http://35.196.171.153/isqenidev/download/products/1509367422.jpg', 0, 0, 1, 0, 0, '45', 200.00, 190.00, 190.00, NULL),
	(26, '7', '7', 10, 'فيجي المياه المعبأة في زجاجات زجاجة بلاستيكية', 'Fiji Bottled Water Plastic Bottle 24 x 500ml', 'Translate\nWhat makes Fiji Water so special? (Apart from being available to buy online for delivery to your home\n\nWhat makes Fiji Water so special? (Apart from being available to buy online for delivery to your home\n \n\n101/5000\nما الذي يجعل فيجي المياه الخاصة جدا؟ (وبصرف النظر عن كونها متاحة لشراء عبر الإنترنت للتسليم إلى منزلك', 'Translate\nWhat makes Fiji Water so special? (Apart from being available to buy online for delivery to your home\n\nWhat makes Fiji Water so special? (Apart from being available to buy online for delivery to your home\n \n\n101/5000\nما الذي يجعل فيجي المياه الخاصة جدا؟ (وبصرف النظر عن كونها متاحة لشراء عبر الإنترنت للتسليم إلى منزلك', 0, 65, 'http://35.196.171.153/isqenidev/download/products/1509367657.jpg', 0, 0, 1, 0, 0, '43', 399.00, 300.00, 300.00, NULL),
	(27, '8', '8', 3, 'كونتركس لا يزال زجاجة المياه البلاستيكية', 'Contrex Still Water Plastic Bottle', 'اكتشفت لأول مرة من قبل الملك لويس الخامس عشر الطبيب الشخصي الدكتور باغارد، كونتركس هو المياه الفرنسية شعبية للغاية من كونتركسيفيل في شمال شرق فرنسا', 'First discovered by King Louis XV personal physician Dr. Bagard, Contrex is an extremely popular French water from Contrexeville in north-eastern France', 0, 67, 'http://35.196.171.153/isqenidev/download/products/1509371410.jpg', 0, 0, 1, 0, 0, '54', 400.00, 350.00, 350.00, NULL),
	(28, '9', '9', 2, 'كونتركس لا يزال زجاجة المياه البلاستيكية', 'Contrex Still Water Plastic Bottle', 'اكتشفت لأول مرة من قبل الملك لويس الخامس عشر الطبيب الشخصي الدكتور باغارد، كونتركس هو المياه الفرنسية شعبية للغاية من كونتركسيفيل في شمال شرق فرنسا.', 'First discovered by King Louis XV personal physician Dr. Bagard, Contrex is an extremely popular French water from Contrexeville in north-eastern France.', 0, 45, 'http://35.196.171.153/isqenidev/download/products/1509371735.jpg', 0, 0, 1, 0, 0, '23', 123.00, 567.00, 123.00, NULL),
